mapper.select:

select 

from jvd_win5_haraimodoshi
where KAISAI_NENGAPPI = #{kaisaiNengappi,jdbcType=TIMESTAMP}
  and WIN5_KUMIBAN1 = #{win5Kumiban1,jdbcType=CHAR}
  and WIN5_KUMIBAN2 = #{win5Kumiban2,jdbcType=CHAR}
  and WIN5_KUMIBAN3 = #{win5Kumiban3,jdbcType=CHAR}
  and WIN5_KUMIBAN4 = #{win5Kumiban4,jdbcType=CHAR}
  and WIN5_KUMIBAN5 = #{win5Kumiban5,jdbcType=CHAR}

mapper.delete:

delete from jvd_win5_haraimodoshi
where KAISAI_NENGAPPI = #{kaisaiNengappi,jdbcType=TIMESTAMP}
  and WIN5_KUMIBAN1 = #{win5Kumiban1,jdbcType=CHAR}
  and WIN5_KUMIBAN2 = #{win5Kumiban2,jdbcType=CHAR}
  and WIN5_KUMIBAN3 = #{win5Kumiban3,jdbcType=CHAR}
  and WIN5_KUMIBAN4 = #{win5Kumiban4,jdbcType=CHAR}
  and WIN5_KUMIBAN5 = #{win5Kumiban5,jdbcType=CHAR}

mapper.update:

update jvd_win5_haraimodoshi

  
    INSERT_TIMESTAMP = #{insertTimestamp,jdbcType=TIMESTAMP},
  
  
    UPDATE_TIMESTAMP = #{updateTimestamp,jdbcType=TIMESTAMP},
  
  
    RECORD_SHUBETSU_ID = #{recordShubetsuId,jdbcType=CHAR},
  
  
    DATA_KUBUN = #{dataKubun,jdbcType=CHAR},
  
  
    DATA_SAKUSEI_NENGAPPI = #{dataSakuseiNengappi,jdbcType=TIMESTAMP},
  
  
    WIN5_HARAIMODOSHIKIN = #{win5Haraimodoshikin,jdbcType=DECIMAL},
  
  
    TEKICHU_HYOSU = #{tekichuHyosu,jdbcType=DECIMAL},
  

where KAISAI_NENGAPPI = #{kaisaiNengappi,jdbcType=TIMESTAMP}
  and WIN5_KUMIBAN1 = #{win5Kumiban1,jdbcType=CHAR}
  and WIN5_KUMIBAN2 = #{win5Kumiban2,jdbcType=CHAR}
  and WIN5_KUMIBAN3 = #{win5Kumiban3,jdbcType=CHAR}
  and WIN5_KUMIBAN4 = #{win5Kumiban4,jdbcType=CHAR}
  and WIN5_KUMIBAN5 = #{win5Kumiban5,jdbcType=CHAR}


update jvd_win5_haraimodoshi
set INSERT_TIMESTAMP = #{insertTimestamp,jdbcType=TIMESTAMP},
  UPDATE_TIMESTAMP = #{updateTimestamp,jdbcType=TIMESTAMP},
  RECORD_SHUBETSU_ID = #{recordShubetsuId,jdbcType=CHAR},
  DATA_KUBUN = #{dataKubun,jdbcType=CHAR},
  DATA_SAKUSEI_NENGAPPI = #{dataSakuseiNengappi,jdbcType=TIMESTAMP},
  WIN5_HARAIMODOSHIKIN = #{win5Haraimodoshikin,jdbcType=DECIMAL},
  TEKICHU_HYOSU = #{tekichuHyosu,jdbcType=DECIMAL}
where KAISAI_NENGAPPI = #{kaisaiNengappi,jdbcType=TIMESTAMP}
  and WIN5_KUMIBAN1 = #{win5Kumiban1,jdbcType=CHAR}
  and WIN5_KUMIBAN2 = #{win5Kumiban2,jdbcType=CHAR}
  and WIN5_KUMIBAN3 = #{win5Kumiban3,jdbcType=CHAR}
  and WIN5_KUMIBAN4 = #{win5Kumiban4,jdbcType=CHAR}
  and WIN5_KUMIBAN5 = #{win5Kumiban5,jdbcType=CHAR}
